<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Tenant\Domain\TenantRef;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\ValueObject\TenantTermsOfUseTenantVO;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\ValueObject\TenantTermsOfUseTextVO;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\ValueObject\TenantTermsOfUseEnabledVO;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\ValueObject\TenantTermsOfUseAttachedVO;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\ValueObject\TenantTermsOfUseActivationDateVO;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Domain\ValueObject\TenantTermsOfUseVersionVO;
use Civi\Lughauth\Features\Access\TenantTermsOfUse\Application\Usecase\Enable\TenantTermsOfUseEnableResult;
use PHPUnit\Framework\TestCase;

final class TenantTermsOfUseEnableResultUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new TenantTermsOfUseEnableResult();
        $tenantOneValue = new TenantRef('one');
        $tenantOtherValue = new TenantRef('other');
        $copy = $value->tenant($tenantOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new TenantRef('one'), $value->getTenant());
        $this->assertNotEquals(new TenantRef('other'), $value->getTenant());
        $this->assertEquals(new TenantRef('one'), $value->getTenantOrDefault(TenantTermsOfUseTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals(new TenantRef('other'), $value->getTenantOrDefault(TenantTermsOfUseTenantVO::from($tenantOtherValue))->value());
        $value->unsetTenant();
        $this->assertEquals(new TenantRef('other'), $value->getTenantOrDefault(TenantTermsOfUseTenantVO::from($tenantOtherValue))->value());
        $this->assertNotEquals(new TenantRef('one'), $value->getTenantOrDefault(TenantTermsOfUseTenantVO::from($tenantOtherValue))->value());
        $textOneValue = 'one';
        $textOtherValue = 'other';
        $copy = $value->text($textOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('one', $value->getText());
        $this->assertNotEquals('other', $value->getText());
        $this->assertEquals('one', $value->getTextOrDefault(TenantTermsOfUseTextVO::from($textOtherValue))->value());
        $this->assertNotEquals('other', $value->getTextOrDefault(TenantTermsOfUseTextVO::from($textOtherValue))->value());
        $value->unsetText();
        $this->assertEquals('other', $value->getTextOrDefault(TenantTermsOfUseTextVO::from($textOtherValue))->value());
        $this->assertNotEquals('one', $value->getTextOrDefault(TenantTermsOfUseTextVO::from($textOtherValue))->value());
        $enabledOneValue = true;
        $enabledOtherValue = false;
        $copy = $value->enabled($enabledOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isEnabled());
        $this->assertNotEquals(false, $value->isEnabled());
        $this->assertEquals(true, $value->getEnabledOrDefault(TenantTermsOfUseEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(false, $value->getEnabledOrDefault(TenantTermsOfUseEnabledVO::from($enabledOtherValue))->value());
        $value->unsetEnabled();
        $this->assertEquals(false, $value->getEnabledOrDefault(TenantTermsOfUseEnabledVO::from($enabledOtherValue))->value());
        $this->assertNotEquals(true, $value->getEnabledOrDefault(TenantTermsOfUseEnabledVO::from($enabledOtherValue))->value());
        $attachedOneValue = 'store://bin';
        $attachedOtherValue = 'store://obin';
        $copy = $value->attached($attachedOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals('store://bin', $value->getAttached());
        $this->assertNotEquals('store://obin', $value->getAttached());
        $this->assertEquals('bin', $value->getAttachedOrDefault(TenantTermsOfUseAttachedVO::from($attachedOtherValue))->value());
        $this->assertNotEquals('obin', $value->getAttachedOrDefault(TenantTermsOfUseAttachedVO::from($attachedOtherValue))->value());
        $value->unsetAttached();
        $this->assertEquals('obin', $value->getAttachedOrDefault(TenantTermsOfUseAttachedVO::from($attachedOtherValue))->value());
        $this->assertNotEquals('bin', $value->getAttachedOrDefault(TenantTermsOfUseAttachedVO::from($attachedOtherValue))->value());
        $activationDateOneValue = (new \DateTimeImmutable('1980-08-20T14:32:45.123Z'));
        $activationDateOtherValue = (new \DateTimeImmutable('1981-09-06T14:32:45.123Z'));
        $copy = $value->activationDate($activationDateOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getActivationDate());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getActivationDate());
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getActivationDateOrDefault(TenantTermsOfUseActivationDateVO::from($activationDateOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getActivationDateOrDefault(TenantTermsOfUseActivationDateVO::from($activationDateOtherValue))->value());
        $value->unsetActivationDate();
        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getActivationDateOrDefault(TenantTermsOfUseActivationDateVO::from($activationDateOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getActivationDateOrDefault(TenantTermsOfUseActivationDateVO::from($activationDateOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(TenantTermsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(TenantTermsOfUseVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(TenantTermsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(TenantTermsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
